	// HTTP GET request
	private void sendGet(String url) throws Exception {
		totalRequestedUrl++;
		if (totalRequestedUrl % 100 == 1) {
			System.out.println("total requested url  : " + totalRequestedUrl);
		}
		if (url.contains("zara") && !url.contains("https")) {
			url = url.replace("http", "https");
		}
		URL obj = new URL(url);
		HttpURLConnection con = (HttpURLConnection) obj.openConnection();
		// optional default is GET
		con.setRequestMethod("GET");
		// add request header
		con.setRequestProperty("User-Agent", USER_AGENT);
		con.setConnectTimeout(1000);

		int responseCode = con.getResponseCode();
		// ynlendirme varsa gittigi url
		URL redirectURL = con.getURL();
		if (url.contains("lcwaikiki") && responseCode == 404) {
			writeIntoConsole(url, responseCode, redirectURL);
		}

		if (url.contains("defacto") && !url.equals(redirectURL.toString())) {
			writeIntoConsole(url, responseCode, redirectURL);
		}
		if (url.contains("zara")
				&& (responseCode == 404 || findWithPattern(redirectURL.toString(), "p[0-9]\\d{3,}", 0) == null)) {
			writeIntoConsole(url, responseCode, redirectURL);
		}
		if (url.contains("mango")
				&& (responseCode == 404 || findWithPattern(redirectURL.toString(), "_[0-9]\\d{3,}.html", 0) == null)) {
			writeIntoConsole(url, responseCode, redirectURL);
		}
		if (url.contains("hm.com")) {

			BufferedReader in = new BufferedReader(new InputStreamReader(con.getInputStream()));
			String inputLine;
			StringBuffer response = new StringBuffer();
			while ((inputLine = in.readLine()) != null) {
				response.append(inputLine);
			}
			in.close();
			if (response.toString().contains("rn bulunamad")) {
				writeIntoConsole(url, responseCode, redirectURL);
			}

		}
	}

	// eriilemeyen uriyi consol'a yazdr
	private void writeIntoConsole(String url, int responseCode, URL redirectURL) {
		counter++;
		System.out.println("Count : " + counter + "  Response Code : " + responseCode + "\nrequested : " + url);
		System.out.println("redirect : " + redirectURL + "\n");
	}

	protected String findWithPattern(String uri, String pattern, Integer groupNo) {
		Pattern r = Pattern.compile(pattern);
		Matcher m = r.matcher(uri);
		if (m.find()) {
			return m.group(groupNo);
		}
		return null;
	};

